using System.Collections.Generic;
using System.Numerics;
using Nethereum.ABI.FunctionEncoding.Attributes;
using Nethereum.Contracts;

namespace Infura.SDK.Common.Contracts.Templates.ERC1155
{
    public class ERC1155MintableDeploymentBase : ContractDeploymentMessage
    {
        public static string BYTECODE = "";
        public ERC1155MintableDeploymentBase() : base(BYTECODE) { }
        public ERC1155MintableDeploymentBase(string byteCode) : base(byteCode) { }
        [Parameter("string", "uri_", 1)]
        public virtual string Uri { get; set; }
        [Parameter("string", "contractURI_", 2)]
        public virtual string Contracturi { get; set; }
        [Parameter("uint256[]", "ids_", 3)]
        public virtual List<BigInteger> Ids { get; set; }
    }
}